                'id_cliente' => $novoCliente->id,
                'cartao' => $item['cartao']['cartao'],
                'banco' => $item['cartao']['banco'],
                'saqueDisponivel' => $item['cartao']['saqueDisponivel'],
                'margemConsignavel' => $item['cartao']['margemConsignavel'],
                'margemConsignado' => $item['cartao']['margemConsignado'],
            ];

            ClientesCartao::create($cartao);

        }

        echo "<pre>";
        echo 'ok';
        exit;
    }

